package internal

import (
	"time"

	"github.com/GeertJohan/go.rice/embedded"
)

func init() {

	// define files
	file2 := &embedded.EmbeddedFile{
		Filename:    "about.md",
		FileModTime: time.Unix(1607740664, 0),

		Content: string("---\ntitle: About Twtxt.net a self-hosted, Twitter™-like decentralised micro-blogging platform.\n---\n\n# About {{ .InstanceName }}\n\n📕 {{ .InstanceName}} is a [Twt.social](https://twt.social) Pod; a Self-Hosted,\nTwitter™-like Decentralised micro-Blogging platform. No ads, no tracking,\nyour content, your data!\n\n> Technically {{ .InstanceName }} is a [twtxt](https://twtxt.readthedocs.io/en/latest/)\n> client in the form of a web application. You are viewing an instance of\n> this software at {{ .InstanceName }}. {{ .InstanceName }} allows you to make\n> small posts in a simple easy way without privacy concerns, advertising, tracking\n> or the fear of censorship. Think of twtxt as somewhat like Twitter™ but\n> unlike Twitter™ twtxt and {{ .InstanceName }} are designed to be decentralised.\n\nThe [/timeline](/timeline) view displays the latest posts of users on this\ninstance. Since _twtxt_ itself is a federated and decentralised\nmicro-blogging format there is no \"global\" timeline, so you can only discover\nposts from users on the same instance as you are on (_{{ .InstanceName }}\nin this case_) or by searching for other twtxt feeds such as those\navailable at [feeds.twtxt.net](https://feeds.twtxt.net).\n\nThis software and this instance {{ .InstanceName }} requires user registration\nas it both hosts your twtxt feed as well as allows you to fetch, browse, follow\nand read other user's feeds or external feeds. The following is a list of features\nthat are provided:\n\n- Decentralised micro-Blogging, or short-form Posts\n- Backed by the simple to read, parse and write [twtxt](https://twtxt.nreadthedocs.org) format specification\n- Fully supports [Markdown](https://en.wikipedia.org/wiki/Markdown) rendering including 😺 pictures!\n- Supports [wee-are-twtxt](https://github.com/mdom/we-are-twtxt) feed sources format for discovering external feeds\n- Supports [IndieWeb[(https://indieweb.org/) formats and [WebMention(https://www.w3.org/TR/webmention/)\n\nFor a list of upcoming features please follow the [Project Page](https://github.com/jointwt/twtxt) on Github.\n\nFor additional help on how to use twtxt and this instance {{ .InstanceName }}\nplease see the [/help](/help) page or contact [/support](/support) for help.\nPlease also see the [/privacy](/privacy) policy for this instance.\n"),
	}
	file3 := &embedded.EmbeddedFile{
		Filename:    "abuse.md",
		FileModTime: time.Unix(1607740664, 0),

		Content: string("---\ntitle: Twtxt.net Abuse Ppolicy and Community Guidelines\n---\n\n# Abuse Policy\n\n>  Help us build and maintain a safe community.\n\nAt Twt.Social, we believe that everyone is free to express and share their opinions, stories, ideas and thoughts!  You can even create your own pod with your own followers. Your posts are your own, your data is your own, your community is made by you, however Twt.social have a responsibility to provide a safe community.\n\nThe primary focus of the community guidelines will be `@-mentions` and Conversations posted to any pods managed either by the Twt.social  team or pods purchased through the Twt.social hosting service. Pods created and hosted independently are not held to these community guidelines and are beyond Twt.social's scope.\n\nMany great friendships and conversations happen atTtwit.social. Unfortunately from time to time users may engage in what is deemed abusive or harassing behaviour. \n\n**If you are being harassed on a Twt.social pod, or if you notice someone else being harassed, please report the user by going to their profile page and selecting report user. You will be asked to provide an example(s) by providing links to offending Posts by either their URL(s) or Hashes. Alternatively contact the Pod Owner at the /support page.**\n\nThe following will not be tolerated as `@-mentions` to any user or in conversations (_including multimedia content_) on any Twt.social Pod:\n\n- **Hate speech:** Content that attacks other people on the basis of race, ethnicity, national origin, sexual orientation, gender, gender identity, religious affiliation, age, disability, or disease. We will not host Twts or Twt Blogs whose primary purpose is inciting harm towards others on the basis of these categories.\n- **Threats of violence:** You may not threaten violence towards others or use the platform to organize, promote, or incite acts of real-world violence or terrorism.\n- **Harassment:** Repeatedly targeting other people with unwanted @-reply messages.\n- **Posting private information (aka doxxing):** You may not publish or post other people’s private and confidential information, such as credit card numbers, street address, or Social Security/National Identity numbers, without their express authorization and permission. In addition, you may not post intimate photos or videos that were taken or distributed without the subject’s consent.\n- **Illegal activities**: You may not use our service for any unlawful purposes or in furtherance of illegal activities. International users agree to comply with all local laws regarding online conduct and acceptable content.\n\n## What Happens If Someone Violates These Guidelines\n\nWe recognize that the circumstances under which a violation has occurred will vary, and we will tailor our response to the situation that has been reported. We’ll review each abuse report on a case-by-case basis. In each case. The actions that we will take include, but are not limited to, the following:\n\n- A warning to discontinue behavior that violates the guidelines, with specific details on how the guidelines have been violated. Repeated warnings will lead to the removal of the offending User's account and any Feeds they own.\n- Twt.social account will be closed.\n\nThanks for helping us build and maintain a safe and welcoming community on Twt.social.\n\nWe reserve the right to update these guidelines as needed.\n"),
	}
	file4 := &embedded.EmbeddedFile{
		Filename:    "help.md",
		FileModTime: time.Unix(1607740664, 0),

		Content: string("---\ntitle: Help on how to use Twtxt.net\n---\n\n# Help\n\n<details>\n  <summary>Why do I need an account?</summary>\n\n  You need to have an account so the Twtxt Pod can uniquely identity you\n  in a meaningful way and create a personalized timeline based on users\n  and feeds you follow as well as allow you to post Twts against your own\n  user or create feeds to post as different topics of interested or personas.\n\n  Without creating an account you are limited to reading the pod's local\n  user timeline of feeds (_basically all the posts of the users on that pod_)\n  but you are unable to participate. You _may_ also be able to view the\n  profiles of any user on that Pod **provided** the Pod operator has chosen to\n  and configured \"open profiles\". You are also able to follow a user without an\n  account by subscribing to their Atom feed. You can also similarly subscribe to\n  the pod's local timeline of users feeds.\n</details>\n\n<details>\n  <summary>How to create an account?</summary>\n\n  To create an account on {{ .InstanceName }} simply navigate to\n  [/register](/register) assuming the operator of this\n  instance has left user registration open. There you need to fill\n  in a valid Username and Password and optional Email Address\n  (_hich is only used for passwrod recovery_).\n\n</details>\n<details>\n  <summary>How do follow someone?</summary>\n\n  Following someone in the twtxt community is actually rather hard to do\n  because of it being decentralised. This means no one company or entity\n  controls who posts what, where, why or how on their twtxt feeds.\n\n\n  Nevertheless following someone on the same instance ({{ .InstanceName }})\n  you are on is easy! Simply [/login](/login) and navigate to the\n  [/discover](/discover) page to find _public_ posts of\n  users on the same instance. This is a good way to discover new users.\n</details>\n<details>\n  <summary>How do I format my posts?</summary>\n\n  The software that powers this pod {{ .InstanceName }} ([jointwt/twtxt](https://github.com/jointwt/twtxt))\n  supports what's called [Markdown](https://en.wikipedia.org/wiki/Markdown).\n  (_It actually support the full syntax of Markdown really but it is not recommended as twtxt posts are limited  to single lines and length_)\n\n  This means you can format your posts in very simple but powerful ways:\n\n  - Anything that looks like a link is automatically rendered as a click-able link\n  - Use `**bold**` or `_italics_` to place emphasis on your parts of your post\n  - Use `fixed width` to render text in fixed-width or another style of emphasis\n  - Use `[Title](url)` to give your links a nice pretty title\n  - Use `![](url)` to link to external images which will be rendered inline with your post\n\n  Of course twtxt is fully Unicode and Emoji capable so  any Emoji you\n  can type on your keyboard (_uch as the special keyboard on your iPhone_)\n  will also  work nicely 😊\n\n  > **Pro Tip:** Just use the \"Formatting Toolbar\"\n</details>\n"),
	}
	file5 := &embedded.EmbeddedFile{
		Filename:    "privacy.md",
		FileModTime: time.Unix(1607740664, 0),

		Content: string("---\ntitle: Privacy Policy\n---\n\n# Privacy Policy\n\nThis is aimed to be the world's simplest privacy policy.\nThis document should explain to you why the app collects some\ninformation, what happens when your account is deleted and some other\nfrequently asked questions answered regarding your privacy.\n\nIf you have any more questions, please raise an issue regarding\nthe same on GitHub and I'll answer as honest and quickly as possible :)\n\n<details>\n  <summary>What identifiable information is stored about me?</summary>\n  <p>\n    Your username/nickname and your email address is stored along with\n    your user information, and of course. You won't even get any\n    marketing emails, feature updates, newsletters, notification emails,\n    nothing.\n  </p>\n</details>\n\n<details>\n  <summary>How is this all free? There must be a catch!</summary>\n  <p>\n    Absolutely no catch to this freebie. This project is just my way of\n    giving back to the community that I've learned so much from. If you'd\n    like to show your appreciation however, you can follow me on my social\n    media and let me know how much it helped you, or donate to help pay\n    the cloud bills, or if you are a fellow developer, you can head to\n    GitHub and contribute to the code by raising a PR.\n  </p>\n</details>\n"),
	}

	// define dirs
	dir1 := &embedded.EmbeddedDir{
		Filename:   "",
		DirModTime: time.Unix(1607740664, 0),
		ChildFiles: []*embedded.EmbeddedFile{
			file2, // "about.md"
			file3, // "abuse.md"
			file4, // "help.md"
			file5, // "privacy.md"

		},
	}

	// link ChildDirs
	dir1.ChildDirs = []*embedded.EmbeddedDir{}

	// register embeddedBox
	embedded.RegisterEmbeddedBox(`pages`, &embedded.EmbeddedBox{
		Name: `pages`,
		Time: time.Unix(1607740664, 0),
		Dirs: map[string]*embedded.EmbeddedDir{
			"": dir1,
		},
		Files: map[string]*embedded.EmbeddedFile{
			"about.md":   file2,
			"abuse.md":   file3,
			"help.md":    file4,
			"privacy.md": file5,
		},
	})
}

